	.post('/api/auth')
	.send({ apikey: process.env.APIKEY })
	.end(function (err, res) {
		expect(res.statusCode).to.be.equal(400);
		done();
	});

request(baseurl)
	.post('/api/auth')
	.send({ secretid: process.env.SECRETID })
	.end(function (err, res) {
